Hunger (2008) 

Verenigd Koninkrijk 
Drama 
90 minuten 

geregisseerd door Steve McQueen 
met Michael Fassbender, Helena Bereen en Liam Cunningham 

Hunger gaat over de laatste zes weken uit het leven van de Ierse hongerstaker Bobby Sands. Sands zat in 1981 in de beruchte H-blokken van de Maze-gevangenis in Noord-Ierland. De gevangenen kwamen in opstand tegen de barre omstandigheden in de gevangenis. 

